$_MODULE['<{lgcanonicalurls}prestashop>help_f186ab8d807797321861ea3017778973'] = 'Para ver o URL canônico, basta abrir a página em seu front-office, clicar com o botão direito, clicar em “Código fonte da página” e procurar a expressão “canonical” (pode-se usar CTRL + F)';
$_MODULE['<{lgcanonicalurls}prestashop>help_22a7f063e7f26a07c9bb654e9ba815cf'] = 'Informe o Google sobre as versões localizadas de sua página';
$_MODULE['<{lgcanonicalurls}prestashop>help_9275a4f9c598ae359d56b7745d061c57'] = 'Se você tiver várias versões de uma página para diferentes idiomas ou regiões, informe ao Google sobre essas diferentes variações. Isso ajudará a Pesquisa do Google a direcionar os usuários para a versão mais apropriada de sua página por idioma ou região.';
$_MODULE['<{lgcanonicalurls}prestashop>help_72b3c6197b2512dd740ac11293632613'] = 'Observe que, mesmo sem tomar medidas, o Google ainda pode encontrar versões em idiomas alternativos de sua página, mas geralmente é melhor para você indicar explicitamente as páginas específicas de seu idioma ou região.';
$_MODULE['<{lgcanonicalurls}prestashop>help_092d2c999b57682f034c622b9597ccd6'] = 'Alguns exemplos de cenários em que a indicação de páginas alternativas é recomendada:';
$_MODULE['<{lgcanonicalurls}prestashop>help_fbdd76a069f3c6d649e8494222446cd9'] = 'Se o seu conteúdo possui pequenas variações regionais com conteúdo semelhante, em um único idioma. Por exemplo, você pode ter conteúdo em inglês direcionado para os EUA, GB e Irlanda.';
$_MODULE['<{lgcanonicalurls}prestashop>help_44f2b54e329e4bb4b5506aea04b833cf'] = 'Se o conteúdo do seu site está totalmente traduzido em vários idiomas. Por exemplo, você tem versões em alemão e inglês de cada página.';
$_MODULE['<{lgcanonicalurls}prestashop>help_97ad095864fccc01b3ad47f528aa1e55'] = 'Configure sua tag hreflang';
$_MODULE['<{lgcanonicalurls}prestashop>help_a953b16682e47623df99d33d5511eba6'] = 'Ativar tag hreflag no cabeçalho';
$_MODULE['<{lgcanonicalurls}prestashop>help_6b6364ac41009982dfa58d2e531ddaa3'] = 'Ative esta opção se quiser mostrar ao Google urls alternativos para cada idioma';
$_MODULE['<{lgcanonicalurls}prestashop>help_d37fc147e9717a3c4eb06bb9e6e51cb0'] = 'Incluir código de idioma / região';
$_MODULE['<{lgcanonicalurls}prestashop>help_4596abd0b6b17867da26aa03aa69b520'] = 'Se você tiver várias versões de uma página para diferentes regiões, habilite esta opção se quiser adicionar o código da região na tag hreflang (\"en-GB\" em vez de \"en\")';
$_MODULE['<{lgcanonicalurls}prestashop>help_516989128610c7c0dcaf14f03776e1d1'] = 'Adicionar um link alternativo para o idioma padrão';
$_MODULE['<{lgcanonicalurls}prestashop>help_2c42be2758a1530b8b26452783298991'] = 'O valor hreflang = \"x-default\" reservado é usado quando nenhum outro idioma / região corresponde à configuração do navegador do usuário. Este valor é opcional, mas recomendado, como uma forma de controlar a página quando não há correspondência de idioma. Um bom uso é direcionar a página inicial do seu site onde houver um mapa clicável que permite ao usuário selecionar seu país.';
